Overview: This is LunarUi addon/matching theme for adw launcher.

If you have not checked out LunarUi theme chooser yet please do get it from my dev pub. You do not need cyanogenmod 7 to use this theme. It is only recommended you get the cm7 theme for the full effect. This adw theme inludes several docks and icons and will be updated daily with newly requested icons made. 

dock is built in to get pngs go to my xda thread
Read through the threads on xda. The clock with the weather is mClock and that is a skin I made. Also the miui clock. The transparent stausbar needs a patch be activated as well as the center clock. If you have a question contact me on xda or email me. Not ask with a comment cause I won't read it. That is very informal. The icons are included. If you want the icons, docks, and other stuff in picture format I suggest you visit my thread at xda http://forum.xda-developers.com/showthr ... ?t=1243590 (full features list is there)
